Object.Field:
DECLARE
v_emp int:=0;
BEGIN
  SELECT count(*) into v_emp FROM ALL_TABLES where table_name = 'TBL_PAIS_CAP' and owner ='ADMIN_SPA'; 

  IF v_emp = 0 then
     EXECUTE IMMEDIATE 'create table ADMIN_SPA.TBL_PAIS_CAP (id_pais NUMBER, nombre_pais VARCHAR2(300), indicativo VARCHAR2(300), moneda VARCHAR2(100))';
  END IF;
END;
